import TextField from "@mui/material/TextField";
import { SxProps } from "@mui/material/styles";

const boxSX = {
  "&:hover": {
    border: "1px solid #00FF00",
    color: 'gray',
    backgroundColor: 'lightblue'
  },
};

<Box sx={boxSX}>Hover Me!</Box>
